	public static void main(String[] argList) throws HardwareException, InterruptedException {

		System.out.println("--------------------------------------");
		System.out.println("          Starting Emulation          ");
		System.out.println("--------------------------------------");

		double cpuClock = 1020484d;
		double unitsPerCycle = (1000l<<GRANULARITY_BITS_PER_SECOND)/cpuClock;  // 1020484hz at 20 bits per ms granularity
		double cpuMultiplier = 1d; // 1020484hz
		double displayMultiplier = 1./17030.;  // 59.92fps
		
		PriorityQueue<HardwareManager> hardwareManagerQueue = new PriorityQueue<>();
		
		String programName;
		if( argList.length==0 || PROGRAM_LIST.get(argList[0])==null )
			programName = "AppleIIeRom";
		else
			programName = argList[0];
		Program program = PROGRAM_LIST.get(programName);
		
		System.out.println("Loading \""+programName+"\" into memory");
		System.out.println(program);

		Memory8 rom16k = new Memory8(0x4000);
		Memory8 memory = new Memory8(0x20000);
		MemoryBus8 bus;
		Cpu65c02 cpu;
		KeyboardIIe keyboard = null;
		
		if( program.getLayout()==MachineLayoutType.DEMO_32x32 ) {
			keyboard = new KeyboardIIe();
			bus = new MemoryBusDemo8(memory, keyboard);
			bus.coldRestart();
			cpuMultiplier /= 32d;
			hardwareManagerQueue.add(cpu = new Cpu65c02(bus, (long) (unitsPerCycle/cpuMultiplier)));
			cpu.getRegister().setA(0);
			cpu.getRegister().setX(0);
			cpu.getRegister().setY(0);
			cpu.getRegister().setS(0);
			cpu.getRegister().setP(0);
			hardwareManagerQueue.add(new Display32x32(bus, keyboard, (long) (unitsPerCycle/displayMultiplier)));
		} else if( program.getLayout()==MachineLayoutType.DEMO_32x32_CONSOLE ) {
			displayMultiplier = 10d/cpuClock;
			bus = new MemoryBusDemo8(memory, null);
			bus.coldRestart();
			cpuMultiplier /= 32d;
			hardwareManagerQueue.add(cpu = new Cpu65c02(bus, (long) (unitsPerCycle/cpuMultiplier)));
			cpu.getRegister().setA(0);
			cpu.getRegister().setX(0);
			cpu.getRegister().setY(0);
			cpu.getRegister().setS(0);
			cpu.getRegister().setP(0);
			hardwareManagerQueue.add(new Display32x32Console(bus, (long) (unitsPerCycle/displayMultiplier)));
		} else if( program.getLayout()==MachineLayoutType.DEBUG_65C02 ) {
			keyboard = new KeyboardIIe();
			rom16k.coldRestart();
			bus = new MemoryBusAppleIIe(memory, rom16k, keyboard);
			bus.coldRestart();
			hardwareManagerQueue.add(cpu = new Cpu65c02(bus, (long) (unitsPerCycle/cpuMultiplier)));
			cpu.coldRestart();
			hardwareManagerQueue.add(new DisplayConsoleDebug(cpu, (long) (unitsPerCycle/cpuMultiplier)));
		} else {
			displayMultiplier = 60d/cpuClock;
			keyboard = new KeyboardIIe();
			rom16k.coldRestart();
			bus = new MemoryBusAppleIIe(memory, rom16k, keyboard);
			bus.coldRestart();
			hardwareManagerQueue.add(cpu = new Cpu65c02(bus, (long) (unitsPerCycle/cpuMultiplier)));
			cpu.coldRestart();
			//hardwareManagerQueue.add(new DisplayConsoleAppleIIe((MemoryBusAppleIIe) bus, (long) (unitsPerCycle/displayMultiplier)));
			hardwareManagerQueue.add(new DisplayAppleIIe((MemoryBusAppleIIe) bus, keyboard, (long) (unitsPerCycle/displayMultiplier)));
		}
		
		if( program.getLayout()==MachineLayoutType.DEBUG_65C02 ||
				program.getLayout()==MachineLayoutType.APPLE_IIE ) {
			
			String pushStr = BASIC_PROGRAM;
			for( int i = 0; i<pushStr.length(); i++ )
				keyboard.pushKeyCode(pushStr.charAt(i));
		}
		
		DecimalFormat format = new DecimalFormat("0.######E0");
		HardwareManager[] managerList = new HardwareManager[hardwareManagerQueue.size()];
		for( HardwareManager manager : hardwareManagerQueue.toArray(managerList) )
			System.out.println(manager.getClass().getSimpleName()+"@"+
					format.format(cpuClock*unitsPerCycle/manager.getUnitsPerCycle())+"Hz");
	
	   	Emulator emulator = new Emulate65c02(hardwareManagerQueue, GRANULARITY_BITS_PER_SECOND);
		int [] opcodeList = program.getCode();
		
		int addr = program.getProgramStart();
		for( int opcode : opcodeList ) {
			if( bus.getClass()==MemoryBusAppleIIe.class && addr>=MemoryBusAppleIIe.ROM_START )
				rom16k.setByte(addr-MemoryBusAppleIIe.ROM_START, opcode);
			else
				memory.setByte(addr, opcode);
			addr++;
		}

/*		System.out.println();
		int endAddr = addr;
		addr = program.getProgramStart();
		while( addr<endAddr ) {
			System.out.println(cpu.getOpcodeString(addr, null));
			addr += Cpu65c02.OPCODE[memory.getByte(addr)].getInstrSize();
		}
*/
		if( program.getCode().length+program.getProgramStart()<0xfffd ) {
			if( bus.getClass()==MemoryBusAppleIIe.class ) {
				rom16k.setByte(0xfffc-MemoryBusAppleIIe.ROM_START, program.getProgramStart());
				rom16k.setByte(0xfffd-MemoryBusAppleIIe.ROM_START, program.getProgramStart()>>8);
			} else {
				memory.setByte(0xfffc, program.getProgramStart());
				memory.setByte(0xfffd, program.getProgramStart()>>8);
			}
		}

		System.out.println();
		emulator.start();
		System.out.println("Done");
	
	}
	
	private static void printFlags(int origA, int origB, int value) {
		System.out.print(Cpu65c02.getHexString(value&0xff, 2)+" ");
		System.out.print((((origA^value)&(origB^value)&0x80)!=0) ? "V":"v");
		System.out.print(value==0 ? "Z":"z");
		System.out.print((value&0x80)!=0 ? "N":"n");
		System.out.println((value&0x100)!=0 ? "C":"c");

	}

	@Test
	public static void testOpcode() {

		boolean carry = false;
		do {
			for( int reg_getA = 0; reg_getA<256; reg_getA++ )
				for( int mem = 0; mem<256; mem++ ) {
					System.out.print(Cpu65c02.getHexString(reg_getA&0xff, 2)+" + ");
					System.out.print(Cpu65c02.getHexString(mem&0xff, 2)+" + ");
					System.out.print((carry ? 1:0)+" = ");
					int value = mem;
					int regA = reg_getA;
					int valAdd = value;
					value += regA;
					if( !carry )
						value++;
					printFlags(regA, valAdd, value);
					
				}
			carry = !carry;
		} while( carry );

	}
	
	@Test
	public static void displayOpcodes() {
		for( int x = 0; x<256; x++ )
			if( Cpu65c02.OPCODE[x].getMnemonic()==Cpu65c02.OpcodeMnemonic.NOP )
				System.out.println(x);
	}
	
